  render() {
    return (
      <div>
        <Grid>
          <Cell className="resume" col={12}>
            <div style={{ textAlign: "center" }}>
            <img className="logo" src={logo} alt="logo...." />
            </div>
            <h2>SKILLS | Development</h2>
            <p>
            I use HTML & CSS every day, and I try to keep up with the latest features while maintaining graceful degradation.
            I use React as part of a develomement team developing a loan application app and periodically I’ve written other Node scripts to automate mundane tasks.
            I use Git for all of my programming work.
            I primarily use GitHub’s Atom text editor for coding.
            </p>
